   local KEYTEXT="Your files are extracted here"
   SIDIR=$(payload_extractor |grep "$KEYTEXT"|cut -d":" -f2)
}
full_auto_mobile_home_client_install (){
   #Takes 1 optional arg:       If arg 1 is present, it is the username to use
   #                            for the default user in the mobile_home
   #                            auto-installation process
   #
   # Auto-installs the HTK, with just Mobile_Home set up as a client system.
